import React from "react";
import Card from "./card";

const Applicants = ({ applicants }) => {
  console.log(applicants);
  return (
    <div>
      {applicants &&
        applicants.map((item) => {
          return <Card article={item} key={`article__left__${item.slug}`} />;
        })}
    </div>
  );
};

export default Applicants;
